import React from 'react';

function Inputs() {
  return (
    <div>
      <section className="mx-36 my-20 flex justify-between">
        <input
          type="text"
          className="h-9 w-1/2 py-2 px-3 appearance-none border border-black rounded-md text-gray-700 leading-tight"
          placeholder="text on the top"
        />
        <input
          type="text"
          className="h-9 w-1/2 py-2 px-3 appearance-none border border-black rounded-md text-gray-700 leading-tight"
          placeholder="text on the bottom"
        />
      </section>
    </div>
  );
}

export default Inputs;
